SELECT (COUNT(DISTINCT ?procedure) AS ?count)
WHERE {
  ?payer a Payer ;
         Payer#name "UnitedHealthcare" .
  ?encounter Payer#payer ?payer .
  ?procedure a Procedure ;
             Procedure#encounter ?encounter .
  FILTER NOT EXISTS {
    ?procedure Procedure#payerCoverage "uncovered" .
  }
}

